import React, { Component } from 'react';
import { Table } from 'reactstrap';



const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Job</th>
                <th>Remove</th>
            </tr>
        </thead>

    );
}
const TableBody = props => {
    const rows = props.charactersData.map((row) => {
        return (
            <tr>
                <td>{row.id}</td>
                <td>{row.name}</td>
                <td>{row.job}</td>
                <td><button className="btn btn-danger" onClick={() => props.removecharacter(row.id)}>Delete</button></td>
            </tr >
        );
    });
    return (
        <tbody>{rows}</tbody>
    )
}

const Table1 = (props) => {
    return (
        <table>
            <TableHeader />
            <TableBody charactersData={props.characterData} removecharacter={props.removecharacter} />
        </table>
    );
}

export default Table1;
